{"phase": "description", "counterbalance": 4, "vidpath": "/static/video/E/filmfest_clip12_E_3.mp4", "descstop": 2, "vidpair": 4, "offset": "170", "content": "The woman walks off with the mans phone into the middle of the road, she says to the person on the other end of the phone that she's here and starts shouting she'll go to the police. The person on the other end hangs up so she breaks the phone and starts crying.

The man mentioned his phone is broken and asks for 60 bucks, then asks if the woman is ok.

It then cuts to a scene with a man driving a car listening to classical music towards them. The man from the side of the road asks who it is but the woman ignores him, he asks again for money for his phone but she continues on towards the car.", "importance": "6", "time": 118406, "tag": "test_seg4_desc"}

{"phase": "description", "counterbalance": 4, "vidpath": "/static/video/E/filmfest_clip12_E_9.mp4", "descstop": 5, "vidpair": 10, "offset": "425", "content": "The man barks and crawls off on all fours down the road barking.
Another woman then crawls towards him barking too.

They bark at each other then sniff each other like dogs, they then start playing and crawl off down the street.", "importance": "6", "time": 49414, "tag": "test_seg10_desc"}

{"phase": "description", "counterbalance": 0, "vidpath": "/static/video/Prac/wildebeest_part2.mp4", "descstop": 1, "vidpair": 2, "offset": "33", "content": "Buffalos were at the water edge looking at a log.  One buffalo tossed a stone at the log thinking it was a crocodile.  
The log did not move and the buffalo then poked the log - there was still no response fro the log.

Finally the buffalo splashed the water vigorously hoping for a response from the " crocodile" but of course it was unresponsive because it was a log!", "importance": "5", "time": 168104, "tag": "prac_segB_desc"}

{"phase": "description", "counterbalance": 0, "vidpath": "/static/video/A/filmfest_clip12_A_7.mp4", "descstop": 4, "vidpair": 8, "offset": "310", "content": "The magician makes a bow as in a gesture towards the bus top man.  The lade stands still observing what is going on.  She pulls out a gun and shoots it in the air.
The 'atmosphere' is darkening - metaphorically.  The magician pulls out his gun.  The man from the bus stop seems to be distressed as the magician pulls out a small coffin with a skeleton in it and mumbles strange words - as if chanting.

The lady opens the trunk of the stationary car ..   the atmosphere seems to be most strange and the man from the bus stop seems to be in a trance of some sort - almost as if he is going to pass out.", "importance": "5", "time": 230732, "tag": "test_seg8_desc"}

{"phase": "description", "counterbalance": 0, "vidpath": "/static/video/A/filmfest_clip12_A_9.mp4", "descstop": 5, "vidpair": 10, "offset": "400", "content": "The situation is really tense.  Bus Stop man has collapsed on the ground.  The magician swears as he looks at a paper.  The lady fires a gun then there is another gunshot.

Next both the lady and the magician, shot, are collapsed on the ground.  There is the sound of a barking dog.  The bus stop man crawls on the ground heading towards the sound of  a barking dog.  Alarmingly there is no dog.  It is a different, younger lady, walking towards him and barking like a dog - as if possessed.

Next the bus stop man starts barking like a dog as if he too has become possessed.  It is really scary at this point.", "importance": "6", "time": 188568, "tag": "test_seg10_desc"}

{"phase": "description", "counterbalance": 2, "vidpath": "/static/video/C/filmfest_clip12_C_7.mp4", "descstop": 4, "vidpair": 8, "offset": "330", "content": "The magician was casting a spell on the guy, and the guy passes out on to the ground.  The woman has opened the trunk of the car and screams.

The guy is not out fully, and the magician realizes he didnt say the spell properly.

The woman hastily angrily walks back", "importance": "7", "time": 63775, "tag": "test_seg8_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip12_G_1.mp4", "descstop": 1, "vidpair": 2, "offset": "100", "content": "A guy is standing around with ice cream in a bag listening to music.

A woman pulls up in a car to a payphone and tries to use it but it doesn't work (as her car starts to slowly roll away).

She then asks to borrow the cell phone of the guy listening to music.", "importance": "5", "time": 72237, "tag": "test_seg2_desc"}
